import '../../src/search/search.css'
import {useEffect} from "react";

export default function Search() {
    const url = "https://jsonplaceholder.typicode.com/comments"

    useEffect(() => {
        fetch(url)
            .then(res => res.json())
            .then(res => console.log(res))
    })

    return (
        <>
            <div className="search">
                <input type="text"/>
                <ul>
                    <li></li>
                </ul>
            </div>
        </>
    )
}
